description:
Celebrating 50 years, GRRR! is the last Rolling Stones compilation, ten years after 40 Licks, another celebratory compilation.

This is the smaller, 2 disc version, containing forty tracks. Seems to be the 'main' version here in Australia, instead of the 3 disc, 50 track version.

FLAC with Replay Gain

